    "2015-03-24T03:53:03.243641",nt"name": "american-housing-survey-ahs",nt"isopen":
    false,nt"url": null,nt"notes": "The AHS is the largest, regular national
    housing sample survey in the United States. The U.S. Census Bureau conducts the
    AHS to obtain up-to-date housing statistics for the Department of Housing and Urban
    Development (HUD).  The most recent AHS was conducted in 2013 and the next AHS will
    be conducted in 2015.  The AHS national survey was conducted annually from 1973-1981
    and biennially (every two years) from 1983 - 2015.  Metropolitan area surveys have
    been conducted annually or biennially since 1974.",nt"license_title": "License
